var lmaLogger = new global.GSLog("com.dxc.global.debugging_enabled", "LMADebug");
try {
	//prevent default record creation
	current.setAbortAction(true);


	var NMLHelper = new x_nesa_ng_obsidian.DXCObsidianNMLUtils();
	var obsidianModel_GR = new GlideRecord(x_nesa_ng_obsidian.DXCObsidianConstants.NML_TABLE_NAMES.MODEL_TABLE);
	var obsidianNewModelLaunch_GR = new GlideRecord(x_nesa_ng_obsidian.DXCObsidianConstants.NML_TABLE_NAMES.NML_TABLE);
	var newObsidianModelSysID = '';

	var obsidianModelsArr = JSON.parse(producer.obsidian_models);
	var obsidianModelsCnt = obsidianModelsArr.length;
	var createdModelNames_array = [];
	var failedModelNames_array = [];
	for (var i = 0; i < obsidianModelsCnt; i++) { // For each Obsidian Model row
		var this_model_name = obsidianModelsArr[i].model_name.toString();


		obsidianModel_GR.initialize();
		obsidianModel_GR.name = this_model_name;
		obsidianModel_GR.supplier = obsidianModelsArr[i].supplier;
		if (producer.project != '') {
			obsidianModel_GR.obsidian_project = producer.project;
		}
		obsidianModel_GR.model_requester_group = producer.model_requester_group;
		obsidianModel_GR.nml_submission_date = new GlideDate();
		obsidianModel_GR.model_requesting_country = producer.model_requesting_country;
		obsidianModel_GR.model_requester_type = producer.model_requester_type;
		newObsidianModelSysID = obsidianModel_GR.insert();

		if (newObsidianModelSysID) {
			var nml_short_description = obsidianModel_GR.name;
			//if (i != obsidianModelsCnt-1){
			// Create a "Obsidian New Model Launch" record for each Obsidian Model row
			obsidianNewModelLaunch_GR.initialize();
			obsidianNewModelLaunch_GR.obsidian_model = newObsidianModelSysID;
			obsidianNewModelLaunch_GR.model_requester_group = producer.model_requester_group;
			obsidianNewModelLaunch_GR.model_requester_type = producer.model_requester_type;
			obsidianNewModelLaunch_GR.nml_checklist_item_json = producer.nml_checklist_item_json;
			obsidianNewModelLaunch_GR.short_description = nml_short_description;
			obsidianNewModelLaunch_GR.model_requesting_country = producer.model_requesting_country;
			obsidianNewModelLaunch_GR.insert();
			createdModelNames_array.push(this_model_name);
		} else {
			failedModelNames_array.push(this_model_name);
		}

	}

	if (createdModelNames_array.length > 0){
		gs.addInfoMessage(gs.getMessage("The following model name(s) have been created:") + "<br>- " + createdModelNames_array.join("<br>- "));
	}

	if (failedModelNames_array.length > 0){
		gs.addErrorMessage(gs.getMessage("The following model name(s) creation have failed:") + "<br>- " + failedModelNames_array.join("<br>- "));

	}
	producer.portal_redirect = 'nsc?id=obsidian_index';

} catch (e) {
	lmaLogger.logErr("error in submit NML record producer script: " + e);
}
